import './App.css';
import {Routes, Route} from 'react-router-dom';
import routes from './config/routes';
//components
import Home from './components/home/home'

function App() {
  return (
    <Routes>
      <Route path={routes.HOME} element={<Home />}/>
      <Route exact path={routes.PROJECTS} element={<AllProjects />}/>
    </Routes>
  );
}

export default App;
